// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "./Fees.sol";

// import '@uniswap/v2-core/contracts/interfaces/IUniswapV2Pair.sol';
import '@uniswap/lib/contracts/libraries/Babylonian.sol';
import '@uniswap/lib/contracts/libraries/TransferHelper.sol';

// import '@uniswap/v2-core/contracts/interfaces/IERC20.sol';
import '@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol';
import '@openzeppelin/contracts/utils/math/SafeMath.sol';
import '@uniswap/v2-periphery/contracts/libraries/UniswapV2Library.sol';

contract SwapToPrice {
    using SafeMath for uint256;

    IUniswapV2Router02 private immutable uniswapV2Router;

    constructor(address tUniswapV2Router) {
        uniswapV2Router = IUniswapV2Router02(tUniswapV2Router);
    }

    // ReserveA = 1.03048 ReserverB = 9704.72
    // aToB = 1.03048 / 9704.72 < 1 = (0.0001061834) True
    // invariant = 1.03048 x 9704.72 = 10000
    // leftSide = 10000000 / 997 = sqrt(10,030.09) = 100.1503
    // rightSide = 0.0010335807422267
    // amountIn = 100.1503 - 0.0010335807422267 = 100.1492664192578
    // returns True - 100.1492664192578
    //
    // maxSpend (1% tax from 90 HBCT) = 0.9 HBCT
    // amountIn = 0.9 HBCT
    // tokenIn = HBCT
    // tokenOut = WETH
    // safeTransferFrom(HBCT, _msgSender(), HBCT, 0.9) - Sender add 0.9 to HBCT Contract
    // safeApprove(HBCT, Router, 0.9) - Approve Router to spend 0.9
    // path = HBCT, WETH
    // swapExactTokensForTokens(0.9, 0, [HBCT, WETH], bnbReiver, deadline)

    // computes the direction and magnitude of the profit-maximizing trade
    function computeProfitMaximizingTrade(uint256 truePriceTokenA, uint256 truePriceTokenB, uint256 reserveA, uint256 reserveB)
                                         pure public returns (bool aToB, uint256 amountIn) {
        aToB = reserveA.mul(truePriceTokenB) / reserveB < truePriceTokenA;

        uint256 invariant = reserveA.mul(reserveB);

        uint256 leftSide = Babylonian.sqrt(
            invariant.mul(aToB ? truePriceTokenA : truePriceTokenB).mul(1000) /
            uint256(aToB ? truePriceTokenB : truePriceTokenA).mul(997)
        );
        uint256 rightSide = (aToB ? reserveA.mul(1000) : reserveB.mul(1000)) / 997;

        // compute the amount that must be sent to move the price to the profit-maximizing price
        amountIn = leftSide.sub(rightSide);
    }

    // swaps an amount of either token such that the trade is profit-maximizing, given an external true price
    // true price is expressed in the ratio of token A to token B
    // caller must approve this contract to spend whichever token is intended to be swapped
    function swapToPrice(address tokenA, address tokenB, uint256 truePriceTokenA, uint256 truePriceTokenB, uint256 maxSpendTokenA,
                         uint256 maxSpendTokenB, address to, uint256 deadline) public {
        // true price is expressed as a ratio, so both values must be non-zero
        require(truePriceTokenA != 0 && truePriceTokenB != 0, "ExampleSwapToPrice: ZERO_PRICE");
        // caller can specify 0 for either if they wish to swap in only one direction, but not both
        require(maxSpendTokenA != 0 || maxSpendTokenB != 0, "ExampleSwapToPrice: ZERO_SPEND");

        bool aToB;
        uint256 amountIn;
        {
            (uint256 reserveA, uint256 reserveB) = UniswapV2Library.getReserves(uniswapV2Router.factory(), tokenA, tokenB);
            (aToB, amountIn) = computeProfitMaximizingTrade(
                truePriceTokenA, truePriceTokenB,
                reserveA, reserveB
            );
        }

        // spend up to the allowance of the token in
        uint256 maxSpend = aToB ? maxSpendTokenA : maxSpendTokenB;
        if (amountIn > maxSpend) {
            amountIn = maxSpend;
        }

        address tokenIn = aToB ? tokenA : tokenB;
        address tokenOut = aToB ? tokenB : tokenA;
        TransferHelper.safeTransferFrom(tokenIn, msg.sender, address(this), amountIn);
        TransferHelper.safeApprove(tokenIn, address(uniswapV2Router), amountIn);

        address[] memory path = new address[](2);
        path[0] = tokenIn;
        path[1] = tokenOut;

        uniswapV2Router.swapExactTokensForTokensSupportingFeeOnTransferTokens(amountIn, 0, path, to, deadline);
    }
}
